window.bookSummaryJSON = "<p><b>An updated version of this title was released on 6/3/24. Customer reviews prior to 6/3/24 relate to the prior version.</b></p> <p><b>An all-star production of a brand new standalone romance from #1 NYT Bestselling author Lauren Blakely, performed by a full cast of twelve narrators: Andi Arndt and Sebastian York, with RC Bray, Jason Clarke, Shane East, Christian Fox, Dion Graham, January LaVoy, Erin Mallon, Robin Miles, Savannah Peachwood, and Julia Whelan. This audiobook also includes an exclusive backstage conversation between Andi Arndt &amp; Sebastian York!</b></p> <p>The one unbreakable rule in the Man Code is this: no matter how beautiful, smart, and clever she is, do not fall in love with your best friend's woman.</p> <p>Yeah, so I screwed up big time when I fell for her. I might have let my sin of unrequited love slide, given everything that went down in the last few years, but Lulu just walked back into my life as vibrant as ever.</p> <p>And the cards are stacked against me once again. We're working together, and the last thing I want to do is mess up her life with a forbidden office romance now that she's finally got the fresh start she deserves.</p> <p>Trouble is, she's even more irresistible than ever, and this time around I'm not sure any code can hold me back. Even if I stand to lose everything...</p> <p>Performed by Andi Arndt and Sebastian York as Lulu &amp; Leo</p> <p>Supporting cast:</p> <p>Ginny: Erin Mallon</p> <p>George: RC Bray</p> <p>Kingsley: January Lavoy</p> <p>Cameron: Dion Graham</p> <p>Dean: Shane East</p> <p>Tripp: Jason Clarke</p> <p>Noah: Christian Fox</p> <p>Tabitha: Julia Whelan</p> <p>Mariana: Robin Miles</p> <p>RaeLynn: Savannah Peachwood</p> <p>Vivian: Robin Miles</p>"; 
